                definitions: "\u003cp class=\"ind\"\u003eMake a formal judgment or decision about a problem or disputed matter.\u003c/p\u003e\u003cp class=\"ind\"\u003eAct as a judge in a competition.\u003c/p\u003e\u003cp class=\"ind\"\u003ePronounce or declare judicially.\u003c/p\u003e",
