                synonyms: "\u003cp class=\"exs\"\u003e\u003cb\u003edeath\u003c/b\u003e, casualty, mortality, victim, loss\u003c/p\u003e\u003cp class=\"exs\"\u003etragedy, disaster, catastrophe, calamity\u003c/p\u003e\u003cp class=Syn\u003ecasualty, death, loss, victim\u003c/p\u003e",
                sounds: "http://img.tfd.com/hm/mp3/F0048700.mp3",
                etymology: "\u003cp\u003eLate 15th century (denoting the quality of causing death or disaster): from French fatalité or late Latin fatalitas, from Latin fatalis ‘decreed by fate’, from fatum (see fate). fatality (sense 1) dates from the mid 19th century.\u003c/p\u003e\u003cp\u003e[1480–90; \u0026lt; Late Latin]\u003c/p\u003e",
