                synonyms: "\u003cdiv class=\"exs\"\u003eauthority, specialist\u003c/div\u003e\u003cdiv class=Syn\u003eexpert, authority, judge, specialist, buff, devotee, boffin, whiz, arbiter, aficionado, savant, maven, appreciator, cognoscente, fundi\u003c/div\u003e",
